import React, { Component } from "react";

export default class EditContent extends Component {
  render() {
    return (
      <div>
        <div>
          <p>List EditContent</p>
          <ul>
              <li>All</li>
              <li>Game</li>
              <li>House</li>
              <li>Pet</li>
              <li>Garden</li>
              <li>Garden</li>
          </ul>
        </div>
      </div>
    );
  }
}
